import React from "react";
import styled from "styled-components";

const FooterContainer = styled.div`
  background-color: #f9f9f9;
  padding-bottom: 5rem;

  & > .textContainer {
    max-width: 45rem;
    grid-template-columns: 1fr;
    width: auto;
    margin: auto;
    height: auto;
  }
`;

const Footer = () => {
  return (
    <FooterContainer>
      <div className="textContainer">tlvud12@gmail.com</div>
    </FooterContainer>
  );
};

export default Footer;
